import raw from './assets/LifeSimulation01.xml';

class map
{
      constructor()
      {
            this.map_height = 0;
            this.map_width = 0;   
      }
      plant = {
          x: 0,
          y: 0,
      }
      get width() { return this.map_width }
      set width(num) { this.map_width = num }
      get height() { return this.map_height }
      set height(num) { this.map_height = num } 
      
}

class plant
{
      constructor()
      {
            this.x = 0;
            this.y = 0;
            this.diameter = 0.0;
            this.num_plants = 0;     
      }
      
      get num_plants() { return this.num_plants }
      set num_plants(num) { this.num_plants = num }
      get diameter() { return this.diameter }
      set diameter(num) { this.diameter = num }

      //get plants() { return this.plants }
      // append_plants(x_coord, y_coord) {
      //       let temp = this.plant;
      //       temp.x = x_coord;
      //       temp.y = y_coord;
      //       this.plants.push(temp)}
      // get_a_plant() {
      //       let temp = this.plant; 
      //       temp = this.plants[0];
      //       if (temp == null)
      //             return(0,0);
      //       else 
      //             return [temp.x, temp.y]; 
      // };
}

const map1 = new map();
const plant1 = new plant();

let plants = [];


fetch(raw)
            .then(r=>r.text())
            .then(text=>{
                  let lines =  text.split('\n');
                  map1.width = parseInt(lines[3]);
                  map1.height = parseInt(lines[6]);
                  plant1.num_plants = parseInt(lines[11]);
                  
                  for (let i = 30; i < map1.num_plants; i += 11){
                        plant1.x = parseInt(lines[i]);
                        plant1.y = parseInt(lines[i+3]);
                        plant1.diameter = parseFloat(i+3);
                        plants.push(plant1);
                  }
            })

export default map1;
